from pyquery import PyQuery as pq
import json
import re

links = []
tmp = set()

with open('bil_html.txt', 'r', encoding='utf-8') as fp:
    a_list = pq(fp.read()).find('.title')
    for a in a_list:
        if pq(a).attr('href') and 'www.bilibili.com/video/' in pq(a).attr('href') and len(pq(a).text())>0 and pq(a).text() not in tmp:
            links.append(pq(a).attr('href')[2:] + ';' + pq(a).text())
            tmp.add(pq(a).text())

import requests

headers = {
    'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/85.0.4183.121 Safari/537.36',
    'referer': 'https://www.bilibili.com/'
}


def download(file_name, url):
    print(url)
    try:
        response_data_file = requests.get(url, stream=True, headers=headers, timeout=10)
        if response_data_file.status_code == 200:
            with open('./file/' + file_name, 'wb') as f:
                for chunk in response_data_file.iter_content(chunk_size=1024):
                    if chunk:
                        f.write(chunk)
    except Exception as err:
        print(err)
        download(file_name, url)

